import React from 'react';
import { motion } from 'framer-motion';

const Hero = () => {
  return (
    <section className="relative bg-white pt-16 pb-20 overflow-hidden">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="lg:grid lg:grid-cols-12 lg:gap-8 items-center">
          <div className="sm:text-center md:max-w-2xl md:mx-auto lg:col-span-6 lg:text-left">
            <motion.h1
              className="text-4xl tracking-tight font-bold text-neurops-black sm:text-5xl md:text-6xl"
              initial={{ opacity: 0, y: 50 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
            >
              <span className="block">Bienvenido al</span>
              <span className="block text-neurops-green">Centro de</span>
              <span className="block">Neuropsicología</span>
              <span className="block text-neurops-royal">Neurops</span>
            </motion.h1>

            <motion.p
              className="mt-3 max-w-md mx-auto text-lg text-gray-600 sm:text-xl md:mt-5 md:max-w-3xl lg:mx-0"
              initial={{ opacity: 0, y: 30 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.2 }}
            >
              Especialistas en neuropsicología y terapia neuronal. Ofrecemos atención personalizada 
              con métodos basados en evidencia científica para mejorar tu calidad de vida.
            </motion.p>

            <motion.div
              className="mt-8 sm:max-w-lg sm:mx-auto sm:text-center lg:text-left lg:mx-0"
              initial={{ opacity: 0, y: 30 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.4 }}
            >
              <motion.button
                className="bg-neurops-green text-white px-8 py-4 rounded-xl text-lg font-semibold hover:bg-neurops-green/90 transition-all duration-200 shadow-lg hover:shadow-xl"
                whileHover={{ scale: 1.05, y: -2 }}
                whileTap={{ scale: 0.95 }}
              >
                Agenda tu cita
              </motion.button>

              <motion.button
                className="ml-4 text-neurops-black border-2 border-neurops-black px-8 py-4 rounded-xl text-lg font-semibold hover:bg-neurops-black hover:text-white transition-all duration-200"
                whileHover={{ scale: 1.05, y: -2 }}
                whileTap={{ scale: 0.95 }}
              >
                Conoce más
              </motion.button>
            </motion.div>
          </div>

          <motion.div
            className="mt-12 relative sm:max-w-lg sm:mx-auto lg:mt-0 lg:max-w-none lg:mx-0 lg:col-span-6 lg:flex lg:items-center"
            initial={{ opacity: 0, x: 50 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.3 }}
          >
            <div className="relative mx-auto w-full rounded-lg shadow-lg lg:max-w-md">
              {/* Ilustración minimalista de cerebro */}
              <div className="relative bg-gradient-to-br from-neurops-blue/10 to-neurops-royal/10 rounded-2xl p-12 h-96 flex items-center justify-center">
                <motion.div
                  className="relative"
                  animate={{ 
                    rotate: [0, 5, -5, 0],
                    scale: [1, 1.02, 1]
                  }}
                  transition={{ 
                    duration: 6,
                    repeat: Infinity,
                    ease: "easeInOut"
                  }}
                >
                  {/* Cerebro SVG minimalista */}
                  <svg
                    width="200"
                    height="200"
                    viewBox="0 0 200 200"
                    fill="none"
                    xmlns="http://www.w3.org/2000/svg"
                    className="drop-shadow-lg"
                  >
                    {/* Cerebro principal */}
                    <path
                      d="M100 30C130 30 155 55 155 85C155 95 150 104 142 110C148 118 150 128 150 138C150 160 135 178 115 185C110 187 105 188 100 188C95 188 90 187 85 185C65 178 50 160 50 138C50 128 52 118 58 110C50 104 45 95 45 85C45 55 70 30 100 30Z"
                      fill="#7EAAD7"
                      className="opacity-80"
                    />
                    
                    {/* Líneas de conexión neuronal */}
                    <g stroke="#79B58C" strokeWidth="2" fill="none" className="opacity-60">
                      <motion.path
                        d="M70 70 Q80 60 90 70"
                        initial={{ pathLength: 0 }}
                        animate={{ pathLength: 1 }}
                        transition={{ duration: 2, delay: 1 }}
                      />
                      <motion.path
                        d="M110 70 Q120 60 130 70"
                        initial={{ pathLength: 0 }}
                        animate={{ pathLength: 1 }}
                        transition={{ duration: 2, delay: 1.2 }}
                      />
                      <motion.path
                        d="M80 100 Q100 90 120 100"
                        initial={{ pathLength: 0 }}
                        animate={{ pathLength: 1 }}
                        transition={{ duration: 2, delay: 1.4 }}
                      />
                    </g>

                    {/* Puntos de conexión */}
                    <motion.circle
                      cx="75"
                      cy="75"
                      r="4"
                      fill="#F7DD54"
                      initial={{ scale: 0 }}
                      animate={{ scale: 1 }}
                      transition={{ duration: 0.5, delay: 2 }}
                    />
                    <motion.circle
                      cx="125"
                      cy="75"
                      r="4"
                      fill="#F7DD54"
                      initial={{ scale: 0 }}
                      animate={{ scale: 1 }}
                      transition={{ duration: 0.5, delay: 2.2 }}
                    />
                    <motion.circle
                      cx="100"
                      cy="100"
                      r="4"
                      fill="#D67D2B"
                      initial={{ scale: 0 }}
                      animate={{ scale: 1 }}
                      transition={{ duration: 0.5, delay: 2.4 }}
                    />
                  </svg>
                </motion.div>

                {/* Elementos decorativos flotantes */}
                <motion.div
                  className="absolute top-8 right-8 w-4 h-4 bg-neurops-yellow rounded-full"
                  animate={{ y: [0, -10, 0] }}
                  transition={{ duration: 3, repeat: Infinity, ease: "easeInOut" }}
                />
                <motion.div
                  className="absolute bottom-8 left-8 w-3 h-3 bg-neurops-orange rounded-full"
                  animate={{ y: [0, -8, 0] }}
                  transition={{ duration: 2.5, repeat: Infinity, ease: "easeInOut", delay: 0.5 }}
                />
                <motion.div
                  className="absolute top-1/2 left-4 w-2 h-2 bg-neurops-red rounded-full"
                  animate={{ x: [0, 8, 0] }}
                  transition={{ duration: 4, repeat: Infinity, ease: "easeInOut", delay: 1 }}
                />
              </div>
            </div>
          </motion.div>
        </div>
      </div>

      {/* Elementos decorativos de fondo */}
      <div className="absolute inset-y-0 right-0 w-1/2 opacity-5">
        <svg className="absolute inset-0 h-full w-full" fill="currentColor" viewBox="0 0 100 100">
          <defs>
            <pattern id="hero-pattern" x="0" y="0" width="20" height="20" patternUnits="userSpaceOnUse">
              <rect x="0" y="0" width="4" height="4" className="text-neurops-green" />
            </pattern>
          </defs>
          <rect width="100" height="100" fill="url(#hero-pattern)" />
        </svg>
      </div>
    </section>
  );
};

export default Hero;
